import './Form.css'
const Form = () => {
  return (
    <div className="form">
      <form>
        <div>
            <input type={'text'}> </input>
          <label>Username</label>
        </div>

        <div>
        
          <label>Age(years)</label>
        </div>
      </form>
    </div>
  );
};

export default Form;
